import {useRouter} from "next/router";
import Header from "../../components/Header";
import React from "react";

export async function getServerSideProps(context){
    //api key for google search
    // AIzaSyDPDWPBR6U4jktm6-Mf48I3B4MBPGrE-oo


    let results = []
    return{props: {results}}

}

const Page = ({results}) => {
    const router = useRouter();

    //iterate through array of result objects to make list
    const resultsList = results.map((result) => {
        return(
            <li>
                <img src={'/'} width="72" height="72"/>
                <a href={'/'}></a>
            </li>
        )
    });

    return (
        <div>
            <Header />
            <div>
                <div>
                    <p>Business Search results for: <a>{router.query.pagesearch}</a></p>
                </div>
                <ul>
                    {resultsList}
                </ul>
            </div>
        </div>
    );
};

export default Page;
